import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  return (
    <div>
        <ExpenseItem
            date={props.mockData[0].date}
            amount={prop.mockData[0].purchase_amount}
            points={prop.mockData[0].reward_points}
        />
    </div>
  );
}


export default Expenses;
